def all_prefixes(string: str) -> List[str]:
    """ Return list of all prefixes from shortest to longest of the input string
    >>> all_prefixes('abc')
    ['a', 'ab', 'abc']
    """
    all_prefixes = []
    while string:
        for prefix in string.split(' '):
            if len(prefix) > 1:
                all_prefixes.append(prefix +'')
            else:
                break
    return all_prefixes

