def all_prefixes(string: str) -> List[str]:
    """ Return list of all prefixes from shortest to longest of the input string
    >>> all_prefixes('abc')
    ['a', 'ab', 'abc']
    """
    result = []
    for word in string:
        for i in range(len(word)):
            if word[i] == word[-2:] or word[i] == word[:-1]:
                result.append(word[:-1])
    return result
